    return(
        <div className="col">
            <button className='btn btn-outline-secondary' onClick={function(){
                for(var i=0;i<6;i++){
                    Darray.splice(i,1,Math.floor((Math.random()*100)+1));
                    window.location.reload(false);
                    alert(Darray);
                }
            }}>reset</button>
        </div>
    );
}
